import React, { useState, useEffect } from 'react'
import './App.css';
import axios from 'axios'

interface MyData {
  id: number;
  health: number;
  attack: number;
  accuracy: number;
  weapons: any;
  items:any;
  villains: any;

}

const App: React.FC = () => {

  const [adventure, setAdventure] = useState<MyData[]>([])

  useEffect(() => {
    axios.get('https://story-back-end.herokuapp.com/api/story')
      .then(res => setAdventure(res.data))
    }, [])

  return (
    <div>
    {adventure.map(story => (
      <div key={story.id}>
        <h2>Health:{story.health}</h2>
        <p>{story.attack}</p>
      </div>
    ))}
  </div>
  );
}

export default App;
